                            .InnerText,
                        ExchangeSequenceNumber = Filter<long>(cells[columns["Exchange Sequence Number"]]
                            .InnerText),
                        HashCode = row.InnerHtml.GetHashCode(),
                    };

                    newItems.Add(data);
                }

                OnRowChanged(newItems);
            }
            catch (Exception ex)
            {
                _logger.LogError(ex, "Error whilst parsing HTML.");
            }
            finally
            {
                _timer.Start();
            }
        }

        private T Filter<T>(string data) where T: struct =>
            (T)Convert.ChangeType(data.Replace(",", ""), typeof(T));

        public async Task Login()
        {
            await Task.Delay(8000);
            var emailInput = _driver.FindElement(By.Name("username"));
            var passInput = _driver.FindElement(By.Name("password"));
            var submitButton = _driver.FindElements(By.TagName("button")).FirstOrDefault(x => x.Text == "Login");

            emailInput.Click();
            emailInput.SendKeys(_config.GetValue<string>("Username"));

            await Task.Delay(500);

            passInput.Click();
            passInput.SendKeys(_config.GetValue<string>("Password"));

            await Task.Delay(500);

            submitButton!.Click();
            await Task.Delay(12000);
        }
    }
